import ExpenseItem from "./ExpenseItem";
import './Expenses.css'
import Card from "../UI/Card";
import ExpenseFilter from "./ExpenseFilter";
function Expenses(props)
{
    const filterChangeHandler = selectedYear => {
        console.log('Expense.js')
        console.log(selectedYear)
    }
    return (
        <div>
        <Card className="expenses">
            <ExpenseFilter onChangeFilter={filterChangeHandler}/>
        <ExpenseItem
            title={props.item[0].title} amount={props.item[0].amount} date={props.item[0].date}
        ></ExpenseItem>
        <ExpenseItem
            title={props.item[1].title} amount={props.item[1].amount} date={props.item[1].date}
        ></ExpenseItem>
        <ExpenseItem
            title={props.item[2].title} amount={props.item[2].amount} date={props.item[2].date}
        ></ExpenseItem>
        <ExpenseItem
            title={props.item[3].title} amount={props.item[3].amount} date={props.item[3].date}
        ></ExpenseItem>
        </Card>
        </div>)
}

export default Expenses
